import React from "react";
import { Message } from "../../types";
import { View } from "../Themed";

export type ChatMessageProps = {
    message: Message,
}
const ChatMessage = (props: ChatMessageProps) => {
    const { message } = props;
    return (
        <View>
            <Text>{message.content}</Text>

        </View>
    );
}
export default ChatMessage;
